import React, { useState } from "react";

function App() {
  const [count, setCount] = useState(5)
  console.log(count, setCount)
  let increament = () => {
    setCount(count + 1)
  }

  let decrement = () => {
    setCount(count - 1)
  }

  return (
    <div className="App">
     <h1>{count}</h1>
     <button onClick={() => {increament}}>Increament</button>
     <button onClick={decrement}>Decreament</button>
    </div>
  );
}

export default App;
